	}
	handleChange(){
		this.setState({name:'lakshmi'});
	}
  render() {
    return (
      <div className="App">
		<div className="image_view">
			<img stc={this.state.currentImg}></img>
		</div>
        <h1>Hello!</h1>
		<input type="button" onClick={this.handleChange} value="click"/>
      </div>	  
    );
  }
}

export default App;
